let input = `




`;

let cleanedIput = input.replace(/\s/g, '');

function compute(input) {
    let inputArr = input.split('');
    for (let i = 0; i < inputArr.length; i++) {
        let char = inputArr[i];
        let next = inputArr[i+1];
        if (next && char && char !== next && (
            char === next.toUpperCase() || 
            char === next.toLowerCase() || 
            char.toLowerCase() === next ||
            char.toUpperCase() === next)
        ) {
            inputArr.splice(i, 2);
            i-=2;
        }
    }
    return inputArr.length;
}

let result = [];
for (let i = 97; i < 123; i++) {
    let char = String.fromCharCode(i);
    let len = compute(cleanedIput.replace(new RegExp(`[${char}${char.toUpperCase()}]`, 'g'), ''));
    result.push([char, len]);
}

console.log(result.sort((a, b) => a[1] - b[1])[0])
